INSERT [dbo].[Information] ([Id], [Info], [Importance], [Author_Id], [Type], [UpdateTitle], [Count]) VALUES (35, N'Thanks to everyone that came out to all our summer track series meets and to the Capitol mile. Our volunteers really help make these events happen and they do good to promote both running and track and field in the community. A huge shoutout to Jing Shen for doing a great job as volunteer coordinator she really did her best to make sure we had the volunteers we needed and has done an amazing job ! Get ready as we shift gears from summer to fall and cross season!', 0, N'a8bf2ef9-3277-4e86-b45d-cbbb484ff8b8', N'Announcement', N'Summer Track Series', 0)
