INSERT [dbo].[People] ([Id], [Name], [Position], [Bio], [ImagePath], [Grade]) VALUES (3, N'Austin Wolske', N'Treasurer', N'My name is Austin Wolske and I am the current Treasurer for Wisconsin Track Club. I am studying Finance and possibly Economics while planning to graduate in May 2017. I have been a track and cross country runner since high school and couldn''t outgrow the thrill of a tactical 5k race when I came to college. Other ways I enjoy spending the little free time I find include backpacking, downhill skiing, and reading a good book. If you have any questions about the club, finance, or anything really, shoot me an email to awolske@wisc.edu and I would love to answer any questions you have.', NULL, N'Junior')
GO
INSERT [dbo].[People] ([Id], [Name], [Position], [Bio], [ImagePath], [Grade]) VALUES (4, N'India Pungarcher', N'Secretary', N'My name is India Pungarcher, and I am the secretary again this year. I am a junior from Green Bay, WI majoring in dietetics and am completing the global health and leadership certificates as well. WTC has given me the team aspect on UW''s campus that I wanted to continue to be a part of after high school. I am very thankful that I can give back to the club through having this leadership role. If you have any questions, do not hesitate to email me!', N'', N'Senior')
GO
INSERT [dbo].[People] ([Id], [Name], [Position], [Bio], [ImagePath], [Grade]) VALUES (5, N'Alexander Rink', N'Meet Entry Coordinator', N'Hey all, my name is Alexander Rink, and I am the current meet entry coordinator of the Wisconsin Track Club. I am from Appleton, Wisconsin and went to Kimberly High School. In high school I ran both cross country and track all four years, and specialized in the 4x800 and 2 mile in track. As meet entry coordinator I plan on finding some new, fun competition for our team, as well as get nearly all members qualified to drive Wisconsin fleet vehicles for events. I am a distance runner, and usually do 3k and above, but you may see me do a mile every once in a while. Tuesdays and Thursdays I usually do two runs, so let me know if you need someone to run with! I am also an avid half marathon runner, so let me know if you have any questions about half marathons! Besides WTC, I am the social media coordinator for The Ogg association, and starting this August I will be a house fellow in Ogg hall. School wise, I am a biology major going for a certificate in global health. Also, I am on the pre-med track, hopefully to become a pediatrician. I hope to run with you soon!', NULL, N'Senior')
GO
INSERT [dbo].[People] ([Id], [Name], [Position], [Bio], [ImagePath], [Grade]) VALUES (6, N'Scott Franklin', N'Web Systems and Mobile Applications', N'Hi everyone, my name is Scott Franklin and I am the current Webmaster for WTC. I look forward to bringing a lot of great ideas to track and getting out and competing with all of you!', NULL, N'Junior')
GO
